import React, {useEffect , useState} from "react";
import ChatBotSideBar from "./Sidebar";
import PreViewPage from "./ChatPreViewFirst";
import { API } from "config/Api";
import axios from "axios";
const ChatBot = () => {
  const accessToken = localStorage.getItem("Token");
  const [TopicsState, setTopicsState] = useState([])
  useEffect(()=>{
    axios.get(API.BASE_URL+"topics/",{
      headers: {
        Authorization: `Bearer ${accessToken}`,
      },
    }).then((resp)=>{
      setTopicsState(resp.data.data)
    }).catch((error)=>{
      console.log(error)
    })
  },[])


  return (
    <div className="main">
      <div className="chat">
        <div className="side-contetnt">
          <ChatBotSideBar TopicsState={TopicsState} setTopicsState={setTopicsState}/>
        </div>
        <div className="content">
          <PreViewPage />
        </div>
      </div>
    </div>
  );
};
export default ChatBot;
